import React from "react";
import './contactus.css';

const Contactus = () => {
    return (
        <div className="ccs__CU">
            <div className="ccs__CU-container"></div>
            <div className="ccs__CU-text"></div>
            Located in the Bar triangle by Brother Bikes and Drew's Tattoo Shop
        </div>
    )
}
export default Contactus
